import * as helaperApi from "../Api/helperApis.js";

export const addNewTeam = async (NewTeamName) => {
  try {
    const data = await helaperApi.createNewTeam(NewTeamName);
    console.log(data, "dataaaaaaaaaaaaaaaa");
    return data;
  } catch (err) {
    console.log(err);
  }
};
export const deleteTeam = async (team_id) => {
  try {
    const data = await helaperApi.deleteTeam(team_id);
    console.log(data, "dataaaaaaaaaaaaaaaa");
    return data;
  } catch (err) {
    console.log(err);
  }
};
